// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Ownable.sol";

contract Pausable is Ownable {
    bool public paused = false;

    modifier whenNotPaused() {
        require(!paused);
        _;
    }

    modifier whenPaused() {
        require(paused);
        _;
    }

    function pause() onlyOwner whenNotPaused public {
        paused = true;
    }

    function unpause() onlyOwner whenPaused public {
        paused = false;
    }

}

contracts/ReleasableSimpleCoin.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./SimpleCoin.sol";
import "./Pausable.sol";
import "./Destructible.sol";

contract ReleasableSimpleCoin is SimpleCoin, Pausable, Destructible {
    bool public released = false;

    modifier isReleased() {
        if(!released) {
            revert();
        }
        _;
    }

    constructor(uint256 _initialSupply) SimpleCoin(_initialSupply) {}

    function release() onlyOwner public {
        released = true;
    }

    function transferFrom(address _from, address _to, uint256 _amount) override isReleased public returns (bool success) {
        return super.transferFrom(_from, _to, _amount);
    }
}

contracts/FundingLimitStrategy.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

abstract contract FundingLimitStrategy {
    function isFullInvestmentWithinLimit(uint256 _investment, uint256 _fullInvestmentReceived) virtual public view returns (bool);
}

contract CappedFundingStrategy is FundingLimitStrategy {
    uint256 fundingCap;

    constructor(uint256 _fundingCap) {
        require(_fundingCap > 0);
        fundingCap = _fundingCap;
    }

    function isFullInvestmentWithinLimit(uint256 _investment, uint256 _fullInvestmentReceived) override public view returns (bool) {
        bool check = _fullInvestmentReceived + _investment < fundingCap;
        return check;
    }
}

contract UnlimitedFundingStrategy is FundingLimitStrategy {
    function isFullInvestmentWithinLimit(uint256 _investment, uint256 _fullInvestmentReceived) override public view returns (bool) {
        return true;
    }
}

